import React from 'react';
import Appbar from './Appbar'
import Business from "./Businesses"
import './App.css';

function App() {
  const [t, st] = React.useState("Massaquoi Royal");
  return (
    <div className="App">
     <Appbar t={t}/>
     <Business/>
    </div>
  );
}

export default App;
